import React from 'react';
import HeroHeader from '../components/Layout/HeroHeader';
import Home from '../components/Home';

const HomePage: React.FC = () => {
  return (
    <>
      <HeroHeader />
      <Home />
    </>
  );
};

export default HomePage;
